import asyncio
import json
import logging
import os
import sys
from typing import Any

try:
    from agents import (
        Agent,
        AgentOutputSchemaBase,
        ModelSettings,
        OpenAIChatCompletionsModel,
        Runner,
        set_tracing_disabled,
    )
except Exception:
    try:
        from openai_agents import (
            Agent,
            AgentOutputSchemaBase,
            ModelSettings,
            OpenAIChatCompletionsModel,
            Runner,
            set_tracing_disabled,
        )
    except Exception:
        raise ImportError(
            "Unable to import Agent and related classes from 'agents' or 'openai_agents'; "
            "ensure the package is installed (pip install openai-agents==0.*) and the PYTHONPATH is correct."
        )
from agents.mcp import MCPServerSse, MCPServerStdio, MCPServerStreamableHttp

from openai import AsyncOpenAI


async def main():
    # To authenticate with the model you will need to generate a personal access token (PAT) in your GitHub settings.
    # Create your PAT token by following instructions here: https://docs.github.com/en/authentication/keeping-your-account-and-data-secure/managing-your-personal-access-tokens
    openaiClient = AsyncOpenAI(
        base_url="https://models.github.ai/inference",
        api_key=os.environ["GITHUB_TOKEN"],
        default_query={
            "api-version": "2024-08-01-preview",
        },
    )

    # init MCP servers
    servers = [
        MCPServerStdio(
            params={
                "command": "npx",
                "args": [
                    "-y",
                    "@playwright/mcp@latest",
                ],
                "env": {},
            },
            name="aitk-playwright-example",
            client_session_timeout_seconds=30,
        ),
    ]

    # setup logger
    logger = logging.getLogger("openai.agents")
    logger.setLevel(logging.DEBUG)
    logHandler = logging.StreamHandler(sys.stdout)
    logHandler.setFormatter(logging.Formatter("[Agent Log]: %(message)s"))
    logger.addHandler(logHandler)
    set_tracing_disabled(True)

    agent = Agent(
        name="agent",
        instructions="You are a web exploration assistant that can navigate to websites, take screenshots, and provide summaries of web content. You'll help users explore the web by visiting sites and extracting useful information.",
        mcp_servers=servers,
        model=OpenAIChatCompletionsModel("openai/gpt-5", openaiClient),
        model_settings=ModelSettings(
            reasoning={
                "effort": "medium",
            },
        ),
    )

    try:
        for server in servers:
            await server.connect()
        result = await Runner.run(
            agent,
            [
                {
                    "role": "user",
                    "content": [
                        {
                            "type": "input_text",
                            "text": "Please navigate to https://www.example.com and perform the following tasks:\n1. Take a screenshot of the main page\n2. Extract the main heading and purpose of the website\n3. Provide a brief summary of what the website is all about (2-3 sentences)",
                        },
                    ],
                },
                {
                    "id": "",
                    "type": "message",
                    "role": "assistant",
                    "status": "completed",
                    "content": [
                        {
                            "type": "output_text",
                            "text": '[{"type":"text","text":"### Ran Playwright code\\n```js\\nawait page.goto(\'https://www.example.com\');\\n```\\n\\n### Page state\\n- Page URL: https://www.example.com/\\n- Page Title: Example Domain\\n- Page Snapshot:\\n```yaml\\n- generic [ref=e2]:\\n  - heading \\"Example Domain\\" [level=1] [ref=e3]\\n  - paragraph [ref=e4]: This domain is for use in documentation examples without needing permission. Avoid use in operations.\\n  - paragraph [ref=e5]:\\n    - link \\"Learn more\\" [ref=e6] [cursor=pointer]:\\n      - /url: https://iana.org/domains/example\\n```\\n"}]',
                            "annotations": [],
                        },
                    ],
                },
                {
                    "id": "",
                    "type": "message",
                    "role": "assistant",
                    "status": "completed",
                    "content": [
                        {
                            "type": "output_text",
                            "text": '[{"type":"text","text":"### Result\\nTook the viewport screenshot and saved it as C:\\\\Users\\\\makza\\\\AppData\\\\Local\\\\Temp\\\\playwright-mcp-output\\\\1761550196651\\\\example-main-page.png\\n\\n### Ran Playwright code\\n```js\\n// Screenshot viewport and save it as C:\\\\Users\\\\makza\\\\AppData\\\\Local\\\\Temp\\\\playwright-mcp-output\\\\1761550196651\\\\example-main-page.png\\nawait page.screenshot({\\nscale: \'css\',\\n  type: \'png\'\\n});\\n```\\n"},{"type":"image","mimeType":"image/png","data":""}]',
                            "annotations": [],
                        },
                    ],
                },
                {
                    "id": "",
                    "type": "message",
                    "role": "assistant",
                    "status": "completed",
                    "content": [
                        {
                            "type": "output_text",
                            "text": 'Here are the results from your requested exploration of https://www.example.com:\n\n1. Screenshot: The main page screenshot has been captured. (Let me know if you want to view or download the image.)\n2. Main Heading: "Example Domain"\n3. Website Purpose & Summary:\n   - The website is intended for use in documentation and educational examples, providing a standard placeholder domain name. It is not for use in actual web operations and requires no special permission for reference in instruction or code samples.\n   - In brief, Example.com serves as a safe and neutral domain for illustrating concepts, teaching, and creating sample code. It includes a link for further information about example domains.\n\nIf you\'d like the screenshot file or further details, let me know!',
                            "annotations": [],
                        },
                    ],
                },
                {
                    "role": "user",
                    "content": [
                        {
                            "type": "input_text",
                            "text": "How to communicate?",
                        },
                    ],
                },
            ],
        )
        print("")
        print("[Model Response] " + str(result.final_output))
    except Exception as e:
        print(f"\nError: {str(e)}")
    finally:
        for server in servers:
            await server.cleanup()


if __name__ == "__main__":
    try:
        asyncio.run(main())
    except asyncio.exceptions.CancelledError:
        # ignore cleanup cancel error
        pass
